import styled from "styled-components";

const Contact = () => {
  return (
  <Wrap>
    <Title>
        <Text>Project</Text>
        <Line />
      </Title>
  </Wrap>
  );
};

export default Contact;

const Wrap = styled.main`
  width: 100%;
  height: 100vh;
  display: flex;
  background-color: teal;
`;
